const some = (arr) => !!arr && !!arr[0];
/**
 * Returns true if the Recurrence Rule has limit/expand modifiers.
 *
 * Modifiers include BYMONTH, BYWEEKNO, BYYEARDAY, BYMONTHDAY, BYDAY,
 * BYHOUR, BYMINUTE and BYSECOND.
 *
 * See also: https://tools.ietf.org/html/rfc5545#section-3.3.10
 *
 * @hidden
 */
export const hasModifiers = (rrule) => some(rrule.seconds) || some(rrule.minutes) || some(rrule.hours) ||
    some(rrule.yearDays) || some(rrule.monthDays) || some(rrule.weekDays) ||
    some(rrule.months) || some(rrule.weeks);
